import React from 'react';
import styled from 'styled-components';

const HomeContainer = styled.div`
	display: flex;
`;

const HomeIcon = styled.div`
	height: 1rem;
	width: 1rem;
	border-radius: 100%;
	background-color: gray;
`;

const HomeType = styled.h3`
	margin-left: .5rem;
	font-size: 1.4rem;
`;

const HomeLink = () => (
	<h1>hello</h1>
);

export default HomeLink;
